INSERT INTO `avis` (`id_produit`, `id_user`, `titre`, `note`, `commentaire`, `date`) VALUES
(1, 'bayo', 'TROP TOP', 5, 'Ce téléphone est excellent sur tous les points. L\'écran est incroyable et la puissance démesurée tout en offrant une batterie impressionnante. Les photos Smart HDR sont souvent plus réussies qu\'avec des caméras professionnelles.. Bref, cet iPhone est un bijou de technologie, au prix totalement délirant certes, mais qui ravira ceux qui veulent le meilleur de la technologie disponible à ce jour.', '2019-11-05 00:00:00'),
(1, 'sofiane', 'A REVOIR', 3, 'Au premier abord, ca à l\'air d\'etre un super telephone, superbe, qualité au top, son cristallin des la mise en route et qualité de l\'ecran indeniable, superbes couleurs.\r\nA l\'usage, le menu reste complexe, bien plus complexe que sur Huawei. Des qu\'on veut paramétrer un truc un peu poussé, il faut aller fouiner dans les méandres des sous sous sous menus, c\'est une horreur.\r\nLa recharge sans fil est longue, la reconnaissance faciale est juste un jouet, j\'ai testé avec une photo, il se déverrouille. Le déverrouillage par empreinte c\'est l\'inverse, c\'est capricieux, tres capricieux, j\'ai du m\'y reprendre parfois à 3 ou 4 fois, ca c\'est vraiment la base et ca fonctionne parfaitement depuis deja plusieurs années sur toutes les autres grandes marques.', '2019-02-03 00:00:00'),
